pragma solidity ^0.8.0;
// pragma experimental ABIEncoderV2;
// cc bin u vo v u ra khng nn s dng tin t _, u ra nn to tn bin v n khng tn gas v cn thit
    // c th khng to tn bin  tit kim dung lng
// cc mng tham s u vo v u ra s dng "memory" ch khng s dng "calldata" v c gii hn dung lng
// connex v1: u vo khng h tr Tuple v Tuple[], u ra khng h tr Tuple v Tuple[], call trc tip t bin public th h tr Tuple
// connex v2: u vo khng h tr Tuple v Tuple[] ->  bo co vi vechain
// u vo cn h tr connex v1,v2, u ra c th khng cn h tr v1 nu call thng qua server
// VeChain h tr clauses nn khng cn dng Tuple cho u vo, mt clauses b reverted th c giao dch  b reverted
// address(0) khng th l contract nn lm a ch Payment cho native token c

// import "https://github.com/tv-truong/openzeppelin-contracts-4.3.2/contracts/access/Ownable.sol"; // @ [import: Context]
import "@openzeppelin/contracts/access/Ownable.sol";

// openzeppelin-contracts/v4.3.2
interface IERC721_2 {
    // event Transfer(address indexed from, address indexed to, uint256 indexed tokenId);
    // event Approval(address indexed owner, address indexed approved, uint256 indexed tokenId);
    // event ApprovalForAll(address indexed owner, address indexed operator, bool approved);
    function balanceOf(address owner) external view returns (uint256 balance);
    // function ownerOf(uint256 tokenId) external view returns (address owner);
    // function safeTransferFrom(address from, address to, uint256 tokenId) external;
    // function transferFrom(address from, address to, uint256 tokenId) external;
    // function approve(address to, uint256 tokenId) external;
    // function getApproved(uint256 tokenId) external view returns (address operator);
    // function setApprovalForAll(address operator, bool _approved) external;
    // function isApprovedForAll(address owner, address operator) external view returns (bool);
    // function safeTransferFrom(address from, address to, uint256 tokenId, bytes calldata data) external;
    // function supportsInterface(bytes4 interfaceId) external view returns (bool);
    //
    function tokenOfOwnerByIndex(address owner, uint256 index) external view returns (uint256);
}

//
interface IERC721BidV1 {
    function supportedErc721Map(address tokenAddress) external view returns (bool enable, uint256 feeRate);
    function paymentAddressList() external view returns (address[] memory);
    function supportedPaymentMap(address paymentAddress) external view returns (uint256, uint256, uint256, bool);
    function userErc20Balance(address account, address paymentAddress) external view returns (uint256);
    function totalBidOfTokenId(address tokenAddress, uint256 tokenId) external view returns (uint256);
    function userBidIdByTokenId(address account, address tokenAddress, uint256 tokenId) external view returns (uint256);
    function bidIdToBid(uint256 bidId) external view returns (address, address, address, uint256, uint256, uint256, uint256);
    function bidOfBidderByIndex(address bidder, uint256 index) external view returns (uint256, address, address, uint256, uint256, uint256, uint256);
    function bidOfTokenIdByIndex(address tokenAddress, uint256 tokenId, uint256 index) external view returns (uint256, address, address, uint256, uint256, uint256);
}
//---------------------------------

// ERC721BidPeripheryV1
contract ERC721BidPeripheryV1 is Ownable {

    IERC721BidV1 public bidContract;
    // ----------------------------------------------------------------------------
    constructor(address _bidContract) {
        bidContract = IERC721BidV1(_bidContract);
    }

    // ----------------------------------------------------------------------------
    // onlyOwner Write Contract
    // ----------------------------------------------------------------------------
    // @
    function setBidContract(address _bidContract) public onlyOwner {
        bidContract = IERC721BidV1(_bidContract);
    }
    // ----------------------------------------------------------------------------
    // end onlyOwner Write Contract
    // ----------------------------------------------------------------------------
    
    // ----------------------------------------------------------------------------
    // Read Contract
    // ----------------------------------------------------------------------------
    // Erc721 ------------------------------
    function supportedErc721s(address[] memory erc721) public view returns (bool[] memory enable, uint256[] memory feeRate) {
        enable = new bool[](erc721.length);
        feeRate = new uint256[](erc721.length);
        for (uint i = 0; i < erc721.length; i++) {
            (bool _enable, uint256 _feeRate) = bidContract.supportedErc721Map(erc721[i]);
            enable[i] = _enable;
            feeRate[i] = _feeRate;
        }
    }
    // end Erc721 ------------------------------

    // Payment ---------------------
    // dng hp ng ngoi vi  tit kim dung lng
    function supportedPayments() public view returns (
        address[] memory erc20,
        uint256[] memory minPrice,
        uint256[] memory lockRequired,
        uint256[] memory feeRate,
        bool[] memory enable
    ) {
        erc20 = bidContract.paymentAddressList();
        minPrice = new uint256[](erc20.length);
        lockRequired = new uint256[](erc20.length);
        feeRate = new uint256[](erc20.length);
        enable = new bool[](erc20.length);
        for (uint i = 0; i < erc20.length; i++) {
            (uint256 _minPrice, uint256 _lockRequired, uint256 _feeRate, bool _enable) = bidContract.supportedPaymentMap(erc20[i]);
            minPrice[i] = _minPrice;
            lockRequired[i] = _lockRequired;
            feeRate[i] = _feeRate;
            enable[i] = _enable;
        }
    }

    // dng hp ng ngoi vi  tit kim dung lng
    function erc20BalancesOf(address account) public view returns (address[] memory erc20, uint256[] memory amount) {
        erc20 = bidContract.paymentAddressList();
        amount = new uint256[](erc20.length);
        for (uint i = 0; i < erc20.length; i++) {
            amount[i] = bidContract.userErc20Balance(account, erc20[i]);
        }
    }
    // end Payment ---------------------

    // Offer ---------------------
    function offersOf(address account, uint256 from, uint256 max, address[] memory _erc721) public view returns (uint256[] memory erc721Indexs, uint256[] memory tokenIdsHasBid) {
        uint256 count = 0;
        uint256[] memory _erc721Indexs = new uint256[](max);
        uint256[] memory _tokenIdsHasBid = new uint256[](max);
        for (uint i = 0; i < _erc721.length; i++) {
            IERC721_2 erc721Contract = IERC721_2(_erc721[i]);
            uint256 balanceOf = erc721Contract.balanceOf(account);
            for (uint j = from; j < balanceOf; j++) {
                uint256 tokenId = erc721Contract.tokenOfOwnerByIndex(account, j);
                uint256 bidsOfTokenId = bidContract.totalBidOfTokenId(_erc721[i], tokenId);
                if (bidsOfTokenId > 0) {
                    _erc721Indexs[count] = i;
                    _tokenIdsHasBid[count] = tokenId;
                    count ++;
                    if (count >= max) break;
                }
            }
            if (count >= max) break;
        }
        erc721Indexs = new uint256[](count);
        tokenIdsHasBid = new uint256[](count);
        for (uint i = 0; i < count; i++) {
            erc721Indexs[i] = _erc721Indexs[i];
            tokenIdsHasBid[i] = _tokenIdsHasBid[i];
        }
    }
    /*
    function offersOfTest(address account, uint256 from, uint256 max, address[] memory _erc721) public view returns (uint256[] memory erc721Indexs, uint256[] memory tokenIdsHasBid) {
        uint256 count = 0;
        uint256[] memory _erc721Indexs = new uint256[](max);
        uint256[] memory _tokenIdsHasBid = new uint256[](max);
        for (uint i = 0; i < _erc721.length; i++) {
            uint256 balanceOf = 5;
            for (uint j = from; j < balanceOf; j++) {
                uint256 tokenId = j;
                uint256 bidsOfTokenId = 1;
                if (bidsOfTokenId > 0) {
                    _erc721Indexs[count] = i;
                    _tokenIdsHasBid[count] = tokenId;
                    count ++;
                    if (count >= max) break;
                }
            }
            if (count >= max) break;
        }
        erc721Indexs = new uint256[](count);
        tokenIdsHasBid = new uint256[](count);
        for (uint i = 0; i < count; i++) {
            erc721Indexs[i] = _erc721Indexs[i];
            tokenIdsHasBid[i] = _tokenIdsHasBid[i];
        }
    }*/
    // end Offer ---------------------

    // Bid ---------------------
    //  s dng hp ng ngoi vi, nu gi trc tip th qua 2 function
    function bidOfBidderByTokenId(address bidder, address tokenAddress, uint256 tokenId) public view returns (
        uint256 bidId,  address paymentAddress, uint256 price, uint256 startedAt, uint256 duration
    ) {
        bidId = bidContract.userBidIdByTokenId(bidder, tokenAddress, tokenId);
        ( , , address _paymentAddress, , uint256 _price, uint256 _startedAt, uint256 _duration) = bidContract.bidIdToBid(bidId);
        return (bidId, _paymentAddress, _price, _startedAt, _duration);
    }
    //
    function bidsOfBidderByIndexs(address bidder, uint256[] memory indexs) public view returns (
        uint256[] memory bidId,
        address[] memory tokenAddress,
        address[] memory paymentAddress,
        uint256[] memory tokenId,
        uint256[] memory price
        // uint256[] memory startedAt, // khng  lu tr nn chuyn startedAt, duration sang function khc
        // uint256[] memory duration
    ) {
        bidId = new uint256[](indexs.length);
        tokenAddress = new address[](indexs.length);
        paymentAddress = new address[](indexs.length);
        tokenId = new uint256[](indexs.length);
        price = new uint256[](indexs.length);
        // startedAt = new uint256[](indexs.length);
        // duration = new uint256[](indexs.length);
        //
        for (uint i = 0; i < indexs.length; i++) {
            // (uint256 bidId, address tokenAddress, address paymentAddress, uint256 tokenId, uint256 price, uint256 startedAt, uint256 duration)
            (uint256 a, address b, address c, uint256 c2, uint256 d, , ) = bidContract.bidOfBidderByIndex(bidder, indexs[i]);
            bidId[i] = a;
            tokenAddress[i] = b;
            paymentAddress[i] = c;
            tokenId[i] = c2;
            price[i] = d;
            // startedAt[i] = e;
            // duration[i] = f;
        }
    }
    //
    function bidsOfBidderByIndexs2(address bidder, uint256[] memory indexs) public view returns (
        uint256[] memory startedAt,
        uint256[] memory duration
    ) {
        startedAt = new uint256[](indexs.length);
        duration = new uint256[](indexs.length);
        //
        for (uint i = 0; i < indexs.length; i++) {
            // (uint256 bidId, address tokenAddress, address paymentAddress, uint256 tokenId, uint256 price, uint256 startedAt, uint256 duration)
            ( , , , , , uint256 e, uint256 f) = bidContract.bidOfBidderByIndex(bidder, indexs[i]);
            startedAt[i] = e;
            duration[i] = f;
        }
    }

    //
    function bidsOfTokenIdByIndexs(address tokenAddress, uint256 tokenId, uint256[] memory indexs) public view returns (
        uint256[] memory bidId,
        // address[] memory bidder, // khng  lu tr nn chuyn bidder sang function khc
        address[] memory paymentAddress,
        uint256[] memory price,
        uint256[] memory startedAt,
        uint256[] memory duration
    ) {
        bidId = new uint256[](indexs.length);
        // bidder = new address[](indexs.length);
        paymentAddress = new address[](indexs.length);
        price = new uint256[](indexs.length);
        startedAt = new uint256[](indexs.length);
        duration = new uint256[](indexs.length);
        //
        for (uint i = 0; i < indexs.length; i++) {
            (uint256 a, , address c, uint256 d, uint256 e, uint256 f) = bidContract.bidOfTokenIdByIndex(tokenAddress, tokenId, indexs[i]);
            bidId[i] = a;
            // bidder[i] = b;
            paymentAddress[i] = c;
            price[i] = d;
            startedAt[i] = e;
            duration[i] = f;
        }
    }
    //
    function bidsOfTokenIdByIndexs2(address tokenAddress, uint256 tokenId, uint256[] memory indexs) public view returns (
        address[] memory bidder
    ) {
        bidder = new address[](indexs.length);
        for (uint i = 0; i < indexs.length; i++) {
            ( , address b, , , , ) = bidContract.bidOfTokenIdByIndex(tokenAddress, tokenId, indexs[i]);
            bidder[i] = b;
        }
    }
    // end Bid ---------------------
    // ----------------------------------------------------------------------------
    // end Read Contract
    // ----------------------------------------------------------------------------
}
